import { useEffect, useState, useRef } from "react";
import Console from "./console.js";
import Controls from "./controls.js";
import Game from "./game.js";
import PGame from './pgame.js';
import Panel from "./panel.js";
import './styles.css';

function App() {
	const [socket, setSocket] = useState(null);
	const [role, setRole] = useState(null);
	const [obj, setObj] = useState(null);
	const [room_name, setRoom_name] = useState(null);
	constÂ [message, setMessage] = useState(null);
	const [p1_score, setP1_score] = useState(0);
	const [p2_score, setP2_score] = useState(0);
	const [players, setPlayers] = useState(0);
	const [state, setState] = useState(-1);
	const [log, setLog] = useState([]);
	const [ready, setReady] = useState(false);
	const roleRef = useRef(null);

	var	toggle_panel = panel => {
		panel = panel ? false : true;
		document.getElementById(panel ? "panel" : "canvas").classList.replace("off", "on");
 		document.getElementById(panel ? "canvas" : "panel").classList.replace("on", "off");
 		document.getElementById("control").classList.replace(panel ? "on" : "off", panel ? "off" : "on");
		if (ready && roleRef === 'host')
	 		setTimeout(() => {
 				document.getElementById("finish_configs").classList.replace(panel ? "off" : "on", panel ? "on" : "off");
 			}, 2000);
	}

	var	connect = () => {
		const ws = new WebSocket('ws://localhost:8000/ws/game/');
		ws.onmessage = e => {
			var data = JSON.parse(e.data);
			if (data.msg_type == 'server update') {
				if (data.role)	setRole(data.role);
				if (data.message)	setMessage(data.message);
				if (data.room_name)	setRoom_name(data.room_name);
			}
			else if (data.msg_type == 'pair update') {
				if (data.obj && data.target === roleRef.current)
					setObj(data.obj);
			}
		}
		ws.onerror = e => {
			ws.close();
			setMessage("error on socket");
		}
		ws.onclose = e => setMessage("socket closed")

		setSocket(ws);
		return	ws;
	}

	useEffect(() => {
		const	ws = connect();
		return () => {
			if (ws.OPEN) ws.close();
			setMessage("socket is done");
		}
	}, [])
	useEffect(() => { roleRef.current = role }, [role])
	useEffect(() => {
		if (message === 'pair disconnected') {
			setState(2);
			if (socket.OPEN)	socket.close();
			//connect();
		}
		setReady(message === 'you just got a pair');
	}, [message])
	var	send_update = (msg, obj, target) => {
		if (!socket.OPEN) return ;
		socket.send(JSON.stringify({
			obj: obj,
			target: target,
			message: msg,
		}))
	}

	return (
		<div className="App">
			<div id="wrapper">
				<div id="scores">
					<h1>{p1_score}</h1>
					<h1>{p2_score}</h1>
				</div>
				<Panel
					toggle={() => {
						setP1_score(0);
						setP2_score(0);
						toggle_panel(true);
					}}
					state={state}
					setState={setState}
					players={players}
					setPlayers={setPlayers}
					message={message}
					room_name={room_name}
					role={role}
					ready={ready}
				/>
				{
					role === 'host' && ready ?
					<Game
						state={state}
						setState={setState}
						players={players}
						setPlayers={setPlayers}
						p_1={setP1_score}
						p_2={setP2_score}
						log={log}
						enemies={10}
						coins={30}
						setLogs={setLog}
						send_update={(a, b, c) => send_update(a, b, c)}
						toggle={() => toggle_panel(false)}
						game_update={obj}
					/>
					: role === 'guest' ?
					<PGame
						state={state}
						setState={setState}
						players={players}
						setPlayers={setPlayers}
						setLogs={setLog}
						p_1={setP1_score}
						p_2={setP2_score}
						send_update={(a, b, c) => send_update(a, b, c)}
						toggle={mode => toggle_panel(mode)}
						game_update={obj}
					/>
					: []
				}
				<Controls
					state={state}
					setState={setState}
					players={players}
					setPlayers={setPlayers}
				/>
			</div>
		<Console log={log} />
	</div>
	)
}

export default App;
